note_models.css:
@font-face {
   font-family: 'kanji_strokeorder';
   font-style: normal;
   font-weight: 400;
   src: url(_KanjiStrokeOrders.ttf) format('truetype');
 }
@font-face {
   font-family: 'IPAGothic';
   font-style: normal;
   font-weight: 400;
   src: url(_ipag.ttf) format('truetype');
 }
:root{
	--highlight: #5E81AC;
	--least-important:#4C566A;
	--highlight2: #BF616A;
	--slight_highlight: #434C5E;
	--default: #2E3440;
	--hint: #5E81AC;
	--dark_hint:#B48EAD;
	--dark_default:#E5E9F0;
	--dark_highlight:#5E81AC;
	--dark_slight_highlight: #88C0D0;
}

body {
margin: 0;
}
.container {
display: flex;
flex-direction: column;
height: 100vh;
}
.card-content {
flex: 1;
padding: 20px;
padding-top:0;
}
.footer {
	padding: 20px;
	padding-bottom: 5px;
	padding-top:0px;
}
.card {
	margin-top: 0px;
	height: 100%;
	font-family:  Helvetica, "IPAGothic", Arial,Verdana,sans-serif;
}
.card p {
	padding: 0;
	position: relative;
}
.card .kanji{
	margin-top:30vh;
	font-size: 120px;
   	font-family: IPAGothic;
	color: var(--highlight);
	height:20vh;
	line-height:10px;
}
.card .kanji i {
	font-family: Helvetica, IPAGothic;
	color: var(--least_important);
	font-size: 20px;
	padding-left: 5px;
	font-style: normal;
}
.card .kanji b {
	font-family: Helvetica;
	font-size: 20px;
	color:var(--least-important);
	font-weight:normal;
}
.card .kanji_card2{
	padding-top: 70px;
	font-size: 70px;
	line-height:15px;
	font-family:IPAGothic;
	color:var(--highlight);
}
.card .kanji_card2 i {
	font-family: Helvetica, IPAGothic;
	color:var(--least-important);
	font-size: 16px;
	padding-left: 5px;
	font-style: normal;
	line-height:10px;
}
.card .kanji_card2 b {
	font-family: Helvetica;
	color:var(--least-important);
	font-size: 20px;
	font-weight:normal;
}
.card p.kanji_back{
	font-size: 20px;
   	font-family: IPAGothic;
	color: var(--slight_highlight);
	padding-top:10px;
	line-height:0px;
	height:5vh;
}
.card p.kanji_back i {
	font-family: Helvetica, IPAGothic;
	color:var(--least-important);
	font-size: 16px;
	font-style: normal;
}
.card p.kanji_back b {
	font-family: Helvetica;
	color:var(--least-important);
	font-size: 16px;
	font-weight: normal;
}
.card .primitive_correction before {
	content: "- ";
	padding-left: 5px;
	color:var(--least-important);
}
.card #compounds {
	font-size: 20px;
	text-decoration: none;
	color: var(--slight_highlight);
}
.card #compounds i{
	font-style: normal;
	font-size: 22px;
	text-decoration: none;
	color: var(--highlight);
}
.card #explanation{
	min-height:15vh;
	font-size: 20px;
	text-align:left;
	color:var(--default);
}
.card #explanation i{
	font-style:normal;
	color: var(--highlight2);
}
.card #explanation b{
	font-weight:normal;
	color:var(--highlight);
}
.card #notes {
	font-size:16px;
	color:var(--least-important);
}
.card #notes u{
	font-size:20px;
	text-decoration: none;
}
.card .meaning {
	font-size: 40px;
	color:var(--highlight);
	margin: 0px;
	padding:0px;
	margin-top:20vh;
	border:0px;
}
.card .meaning i {
	font-style: normal;
 	font-size: 15px;
	line-height:15px;
	color:var(--default);
}
.card .meaning_back_card1 {
	font-size: 40px;
	color:var(--highlight);
	margin: 0px;
	padding:0px;
	border:0px;
}
.card .meaning_back_card1 i {
	font-style: normal;
 	font-size: 15px;
	line-height:15px;
	color:var(--least-important);
}
.card .meaning_back{
	font-size: 20px;
	font-family: Helvetica, IPAGothic, Arial;
	color: var(--slight_highlight);
	padding-top:10px;
}
.card .primitives_back {
	font-family: Helvetica, IPAGothic;
	color:var(--least-important);
	font-size: 20px;
	font-style: italic;
}
#no {
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
}
#links a{
	text-style:normal;
	top:0;
	text-decoration:none;
	padding-left:10px;
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
	padding-top:2px;
}
#lesson {
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:left;
	float:left;
}

/* NIGHT MODE THEMING*/
.card.night_mode .kanji{
	color: var(--dark_highlight);
}
.card.night_mode .kanji i {
	color:var(--least-important);
}
.card.night_mode .kanji b {
	color:var(--least-important);
}
.card.night_mode .kanji_card2{
	color: var(--dark_highlight);
}
.card.night_mode .kanji_card2 i {
	color:var(--least-important);
}
.card.night_mode p.kanji_back{
	color: var(--dark_slight_highlight);
}
.card.night_mode p.kanji_back i {
	color:var(--least-important);
}
.card.night_mode .primitive_correction before {
	color:var(--least-important);
}
.card.night_mode #compounds {
	color: var(--dark_slight_highlight);
}
.card.night_mode .meaning_back_card1 {
	color:var(--dark_highlight);
}
.card.night_mode #compounds i{
	color: var(--highlight);
}
.card.night_mode #explanation{
	color:var(--dark_default);
}
.card.night_mode #explanation i{
	color:var(--dark_hint);
}
.card.night_mode #explanation b{
	color: var(--dark_highlight);
}
.card.night_mode #notes {
	color:var(--least-important);
}
.card.night_mode .meaning {
	color: var(--dark_highlight);
}
.card.night_mode .meaning i {
	color:var(--dark_slight_highlight);
}
.card.night_mode .meaning_back{
	color: var(--dark_slight_highlight);
}
.card.night_mode .meaning_back i {
	color:var(--least-important);
}
.card.night_mode #no {
	color:var(--least-important);
}
.card.night_mode #lesson {
	color:var(--least-important);
}
/* ANDROID SETTINGS */
.android .container {
	height: 97vh; /*AnkiDroid seems to calculate vh with area below buttons*/
}
.android .card p.kanji{
	font-size:120px;
}
.android.card.night_mode {
	background-color:#000000;
}
.android .card p.kanji_card2{
	font-size:120px;
}
